    return (
        <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="Modal de cadastro do especialista"
        aria-describedby="Nesse modal terÃ¡ os dados de cadastro do especialista"
        >
            <Box>
                <Titulo>Cadastre o especialista inserindo os dados abaixo:</Titulo>
            </Box>

        </Modal>
    )
}

export {}
